import React, { Component } from "react";
class Me extends Component{
	goHome = e => {
		e.preventDefault();
		this.props.history.push("/");
	}
	render(){
		return(
			<div className="header" >
				<h1>yo</h1>
				<Button onClick={this.goHome}>Volver</Button>
			</div>
		)
	}
}

export default Me
